import React from 'react';

import s from './Rating.module.css';

const Rating = (props) => {
  const star = '/star.svg'

  return (
      <div className={s.star__container}>
        <svg src={star} alt="1" className={s.star}/>
        <img src={star} alt="2" className={s.star}/>
        <img src={star} alt="3" className={s.star}/>
        <img src={star} alt="4" className={s.star}/>
        <img src={star} alt="5" className={s.star}/>
        <span>3,0</span>
      </div>
  );
};

export default Rating;
